Fuego amigo de Ciudadanos en las comunidades que gobierna el PP

Los casos de corrupción tensan la convivencia en Murcia, Castilla y León y Madrid
Rivera promete eliminar 'el impuesto al sol'
El azul mezclado con el naranja ha permitido obtener el color de la gobernabilidad en cuatro comunidades autónomas. Pero en el dibujo de esos gobiernos, la corrupción provoca borrones. El PP mantuvo la Presidencia en Murcia, La Rioja, Castilla y León y Madrid el año pasado gracias a la firma de acuerdos de investidura con Ciudadanos. Pero los casos de corrupción están tensando la convivencia. La formación emergente, presa de su discurso regeneracionista, radicaliza su fiscalización contra los populares a medida que se destapan tramas, provocando la queja de quien creía contar con un aliado y no un enemigo.
«La corrupción tensa la gobernabilidad. Los viejos partidos no querían que sus imputados por corrupción tuvieran que dejar los cargos públicos. Hay que obligarlos, pero se resisten», reflexiona José Manuel Villegas, vicesecretario general de Ciudadanos. «La corrupción es un caballo de batalla», admiten en el partido.
En sus acuerdos de investidura con el PP, la formación de Albert Rivera incluye el compromiso por la regeneración, que contempla la «separación inmediata de cualquier cargo público que haya sido imputado formalmente por delitos de corrupción política hasta la resolución completa del procedimiento judicial». Por eso, cuando hay amenaza de imputación, recuerdan que sólo seguirá habiendo gobernabilidad si hay dimisión. Así está sucediendo con el presidente de Murcia, al que todos los días recuerdan que deberá irse si le imputan. En los casos en que se incumpliera el pacto, Ciudadanos contempla impulsar mociones de censura. Una amenaza velada que ya transmitió Ignacio Aguado a Cristina Cifuentes en Madrid.
«El pacto anticorrupción es lo nuclear. Quiere poner fin a una etapa oscura», señala el líder de C's en Madrid. «El PP está tenso porque supura corrupción. Es verdad que es de una época anterior al Gobierno actual, pero no tenemos por qué desconfiar. Hemos definido bien las reglas para depurar responsabilidades». «No sentimos presión por esta labor de fiscalización. Sabemos que incomoda, pero nosotros estamos en la oposición», completa Villegas. 
La condición de Ciudadanos para permitir la gobernabilidad del PP en las cuatro comunidades mencionadas es mantenerse en la oposición, no entrar en el Ejecutivo, lo que permite sumarse a PSOE y Podemos en muchas ocasiones para aprobar o rechazar propuestas ante el PP. 
Rivera visitó ayer Murcia, donde su partido ha protagonizado una polémica por pagos irregulares de gastos electorales y donde el presidente regional, Pedro Antonio Sánchez, es noticia porque la Guardia Civil propone su imputación por la trama Púnica. «Ahora estamos acostumbrados, pero hace un año se imputaba a un político y no dejaba su cargo. El PP firmó el acuerdo de investidura, pero en su ADN no lleva la regeneración ni la lucha contra la corrupción. No creían en esto, por eso Ciudadanos es tan exigente», cuenta Miguel Sánchez, portavoz naranja en esta comunidad.
En Castilla y León, su presidente, Juan Vicente Herrera, declaró el viernes en una comisión de investigación sobre posibles irregularidades en la construcción del hospital de Burgos, además de contar en esta región con una trama eólica. «El PP venía de mayoría absoluta y tenía que cambiar de actitud. Somos vigilantes y beligerantes para que se cumpla el acuerdo de investidura porque hay que empujarlos, les cuesta mucha dejar la mentalidad de rodillo», confiesa Luis Fuentes, portavoz castellano-leonés de C's. 
En Madrid hay otro match ball porque el juez ha pedido la imputación del diputado del PP Daniel Ortiz por la trama Púnica. «Es un buen momento para ver si el PP se toma en serio este asunto», dice Aguado. A menudo se pone sobre la mesa el argumento de que Ciudadanos no es tan exigente con el PSOE en Andalucía, donde también firmó un acuerdo de investidura, como con el PP. Aguado responde: «Susana Díaz acaba de comparecer en una comisión de investigación. Cifuentes no ha sido llamada. Son dos comunidades, dos casos distintos».
